prompt Creating COPT.REG_LEGAL_CNSS...
create table COPT.REG_LEGAL_CNSS
(
  emp_mat   NUMBER(8) not null,
  emp_cle   NUMBER(2) not null,
  dco_dtdeb DATE not null,
  reg_cod   NUMBER(3) not null,
  cex_cod   NUMBER(4) not null,
  tex_cod   NUMBER(2) not null,
  date_as   DATE not null
)
nologging;
create index COPT.FK_CEX_RLC on COPT.REG_LEGAL_CNSS (REG_COD, CEX_COD);
create index COPT.FK_DOSS_COP on COPT.REG_LEGAL_CNSS (EMP_MAT, EMP_CLE, DCO_DTDEB, REG_COD, CEX_COD);
create index COPT.FK_DOSS_COP_RLC on COPT.REG_LEGAL_CNSS (EMP_MAT, EMP_CLE, DCO_DTDEB);
create index COPT.FK_REGDATE on COPT.REG_LEGAL_CNSS (DATE_AS);
alter table COPT.REG_LEGAL_CNSS
  add constraint PK_REG_LEGAL_CNSS primary key (REG_COD, EMP_MAT, EMP_CLE, DCO_DTDEB, CEX_COD, DATE_AS);
alter table COPT.REG_LEGAL_CNSS
  add constraint FK_REG_LEGA_CEX_RLC_COD_EXPL foreign key (REG_COD, CEX_COD)
  references REFERENTIEL.COD_EXPL (REG_COD, CEX_COD);
alter table COPT.REG_LEGAL_CNSS
  add constraint FK_REG_LEGA_DOSS_COP__DOSSIER_ foreign key (EMP_MAT, EMP_CLE, DCO_DTDEB)
  references COPT.DOSSIER_COP (EMP_MAT, EMP_CLE, DCO_DTDEB);

